import JsBarcode from "jsbarcode";
import { jsPDF } from "jspdf";
import autoTable from "jspdf-autotable";
import { NotoSansRegular } from '../assets/fonts/fonts';
import { convertNumberToMoney, convertToDateTime, randomFileName } from "./lib";

// eslint-disable-next-line
const logoPath = "data:image/png;base64,"

const exportListInvoicePDF = (listRecord) => {
    const doc = new jsPDF({
        orientation: "portrait",
        unit: "mm",
        format: [147, 175],
    });

    doc.addFileToVFS('NotoSans-Regular-normal.ttf', NotoSansRegular);
    doc.addFont('NotoSans-Regular-normal.ttf', 'NotoSans-Regular', 'normal');
    doc.setFont('NotoSans-Regular');

    listRecord.forEach(record => {
        createInvoice(doc, record);

        doc.setLineWidth(0.1);
        doc.setLineDash([5, 1], 0);
        doc.setDrawColor('#ccc');
        doc.line(62, 0, 62, 175);
        doc.line(0, 75, 147, 75);
        doc.line(0, 147.5, 147, 147.5);


        doc.setLineDash(0, 0);
        doc.setDrawColor('#000');
        doc.setLineWidth(2.0);
        doc.line(0, 0, 147, 0);
        doc.line(0, 0, 0, 175);
        doc.line(0, 175, 147, 175);
        doc.line(147, 0, 147, 175);
    })

    const fileName = `invoice_${randomFileName()}.pdf`
    doc.save(fileName);
}

const getPackageInfo = (cart) => {
    let rs = '';
    cart.forEach((value, index) => {
        rs += `${index + 1}. ${value.product.name}${value?.type?.group1 ? `, ${value.type.group1}` : ''}${value?.type?.group2 ? `, ${value.type.group2}` : ''}  SL:${value.amount}\n`;
    });

    return rs;
}

const getPackageWeight = (cart) => {
    let rs = 0;
    cart.forEach(value => {
        const { product } = value;
        rs += product.weight * value.amount;
    });

    return `${rs}g`;
}

const getTotalQty = (cart) => {
    let cnt = 0;
    cart.forEach(value => {
        cnt += value.amount;
    });
    return cnt;
}

const getTotalPrice = (cart) => {
    let rs = 0;
    cart.forEach(value => {
        const { type } = value;
        rs += type.price * value.amount;
    });

    return rs
}

const createInvoice = (doc, record) => {
    const { warehouse, shippingInfo, cart, createdAt, paid } = record;

    const canvas = document.createElement("canvas");
    JsBarcode(canvas, record.orderId);
    const barcodeDataUrl = canvas.toDataURL("image/png");

    const firstRow = [
        {
            content: 'From:', colSpan: 1,
        },
        {
            content: '', colSpan: 2
        },
    ];
    const secondRow = [
        {
            content: `Name: ${warehouse.name}\nAddress: ${warehouse.address}, ${warehouse.city}, ${warehouse.country}`,
            styles: { minCellHeight: 65 },
            colSpan: 1,
        },
        {
            content: '', colSpan: 2
        },
    ]
    const thirdRow = [
        {
            content: 'To:', colSpan: 1,
        },
        {
            content: `Package Information(${cart.length}):`, colSpan: 2,
        },
    ];
    const fourthRow = [
        {
            content: `Name: ${shippingInfo.name}\nAddress: ${shippingInfo.address}, ${shippingInfo.ward}, ${shippingInfo.provine}, ${shippingInfo.city}, ${shippingInfo.country}\nPhone: ${shippingInfo.phone_number}`,
            colSpan: 1,
        },
        {
            content: `${getPackageInfo(cart)}`,
            colSpan: 2,
            styles: { minCellHeight: 65 },
        },
    ]

    const fifthRow = [
        { content: `Order Date: ${convertToDateTime(createdAt)}`, colSpan: 1, },
        { content: `Total Items: ${cart.length}`, colSpan: 1, },
        {
            content: `Total Price:\n${paid ? 0 : convertNumberToMoney(getTotalPrice(cart))} vnd`,
            rowSpan: 2,
            styles: {
                valign: 'middle',
                halign: 'left',
                fontSize: 12,
                fontStyle: 'bold',
                border: { top: 1 }
            },
        }
    ]

    const sixthRow = [
        { content: `Number Of Package: ${1}`, colSpan: 1, },
        { content: `Total Qty: ${getTotalQty(cart)}`, colSpan: 1, },
    ];

    const seventhRow = [
        { content: `Weight: ${getPackageWeight(cart)}`, colSpan: 1, },
        { content: '', colSpan: 1, },
    ]

    autoTable(doc, {
        body: [
            firstRow,
            secondRow,
            thirdRow,
            fourthRow,
            fifthRow,
            sixthRow,
            seventhRow,
        ],
        styles: {
          font: 'NotoSans-Regular',
          fontStyle: 'normal',
        },
        margin: { top: 2, right: 2, bottom: 2, left: 2 },
        headStyles: { fillColor: null, textColor: '#000' },
        columnStyles: {
            0: { cellWidth: 60, fillColor: '#fff', textColor: '#000' },
            1: { cellWidth: 40, fillColor: '#fff', textColor: '#000' },
            2: { cellWidth: 40, fillColor: '#fff', textColor: '#000' },
        },
        didDrawCell: function (cell) {
            doc.setFillColor(255, 255, 255);
            doc.setTextColor(0, 0, 0);
            if (cell.row.index === 1 && cell.column.index === 1) {
                doc.addImage(logoPath, 'PNG', cell.row.cells[1].x + 10, cell.row.cells[1].y - 10, 60, 40);
                doc.text('BILL NUMBER', cell.row.cells[1].x + 3, cell.row.cells[1].y + 32)
                doc.addImage(barcodeDataUrl, 'PNG', cell.row.cells[1].x, cell.row.cells[1].y + 34, 80, 30)
            }
        },
        showHead: 'never',
    })
}

export default exportListInvoicePDF;